window.bookSummaryJSON = "<p><b>After a month of hunting for her, Asher isn’t expecting to stumble across Brie again, but once he does, he’s determined not to let her go.</b></p> <p>Brie knew it was a mistake to warn the hunter about the approaching danger facing the Alliance compound. She learned long ago that getting involved resulted in pain. However, she couldn’t resist trying to help, and now she’s paying for her mistake.</p> <p>When Asher learns Brie is hiding secrets that could be the key to defeating their enemies, he’ll do whatever it takes to protect her, even if it costs him his life.</p> <p><b>Can he keep her safe from the dangers pressing closer, or will the knowledge she holds destroy them all?</b></p>"; 
